script: |
  super -f text -I q8808.spq | sort > q8808.out

inputs:
  - name: q8808.spq
    data: |
      SELECT ALL 75 * col2 - CAST ( + col1 AS INTEGER ) * - col1 * + col2 - - col0 FROM tab2 (FORMAT parquet) WHERE NOT + 73 NOT IN ( - - col2, 1 ) AND NOT - 19 + col2 * + 58 IS NULL;
  - name: tab2

outputs:
  - name: q8808.out
    data: |
